import React from "react";

// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";
import { Autoplay, Navigation } from "swiper/modules";

// Import Swiper styles
import "swiper/css";
import "swiper/css/navigation";
// import "./styles.css";



export default function SwiperCards() {
  return (
    <>
    {/* <div className="container-fluid px-2 px-md-3 px-lg-5 container ">
      <div className="swiper-wrapper">
            <Swiper
              navigation={true}
              modules={[Navigation, Autoplay]}
              autoplay={{ delay: 2500,pauseOnMouseEnter:true }}
              speed={1000}
              slidesPerView={1} // Set number of slides per view
              breakpoints={{
                // Set different configurations based on device size
                1000: {
                  slidesPerView: 2, // Show 2 slides per view on devices larger than or equal to 768px (tablets and desktops)
                },
                1200: {
                  slidesPerView: 3, // Show 3 slides per view on devices larger than or equal to 1024px (desktops)
                },
              }}
              spaceBetween={30}
              className="mySwiper"
          >
            <SwiperSlide className="swiper-cards bg-danger"><br/><br/>Slide <br/><br/>1</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-primary"><br/><br/>Slide <br/><br/>2</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-secondary"><br/><br/>Slide <br/><br/>3</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-success"><br/><br/>Slide <br/><br/>4</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-warning"><br/><br/>Slide <br/><br/>5</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-info"><br/><br/>Slide <br/><br/>6</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-dark"><br/><br/>Slide <br/><br/>7</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-info"><br/><br/>Slide <br/><br/>8</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-white"><br/><br/>Slide <br/><br/>9</SwiperSlide>
          </Swiper>
      </div>
    </div> */}
    <div className="container-fluid px-2 px-md-3 px-lg-5 container ">
      <div className="swiper-wrapper">
            <Swiper
              navigation={true}
              modules={[Navigation, Autoplay]}
              autoplay={{ delay: 2500,pauseOnMouseEnter:true }}
              speed={1000}
              slidesPerView={1} // Set number of slides per view
              breakpoints={{
                // Set different configurations based on device size
                1000: {
                  slidesPerView: 2, // Show 2 slides per view on devices larger than or equal to 768px (tablets and desktops)
                },
                1200: {
                  slidesPerView: 3, // Show 3 slides per view on devices larger than or equal to 1024px (desktops)
                },
              }}
              spaceBetween={30}
              className="mySwiper"
          >
            <SwiperSlide className="swiper-cards bg-danger"><br/><br/>Slide <br/><br/>1</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-primary"><br/><br/>Slide <br/><br/>2</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-secondary"><br/><br/>Slide <br/><br/>3</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-success"><br/><br/>Slide <br/><br/>4</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-warning"><br/><br/>Slide <br/><br/>5</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-info"><br/><br/>Slide <br/><br/>6</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-dark"><br/><br/>Slide <br/><br/>7</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-info"><br/><br/>Slide <br/><br/>8</SwiperSlide>
            <SwiperSlide className="swiper-cards bg-white"><br/><br/>Slide <br/><br/>9</SwiperSlide>
          </Swiper>
      </div>
    </div>
    </>
  );
}
